// AvailableMeals component is responsible for bringing meals list to the screen
import classes from './AvailableMeals.module.css';
import Card from '../UI/Card.js';
import MealItem from './MealItem/MealItem.js';

const DUMMY_MEALS = [
    {
        id: 'm1',
        name: 'Sushi',
        description: 'Finest fish and veggies',
        price: 22.99,
    },
    {
        id: 'm2',
        name: 'Schnitzel',
        description: 'A german specialty!',
        price: 16.5,
    },
    {
        id: 'm3',
        name: 'Barbecue Burger',
        description: 'American, raw, meaty',
        price: 12.99,
    },
    {
        id: 'm4',
        name: 'Green Bowl',
        description: 'Healthy...and green...',
        price: 18.99,
    },
];

function AvailableMeals() {
    const mealsList = DUMMY_MEALS.map(meal => <li key={meal.id}>
        <MealItem name={meal.name} description={meal.description} price={meal.price} />
    </li>);
    // Mapping DUMMY_MEALS array
    return (
        <section className={classes.meals}>
            <Card>
                <ul>
                    {mealsList}
                </ul>
            </Card>
        </section>
    )
}

export default AvailableMeals;
